ERM_hungary.1.t:0 "Negotiate Surrender with Russia?"
ERM_hungary.1.d:0 "With the war inevitably lost we have either the option of staying loyal to Germany and fighting to the bitter end or taking our chances by surrendering to Russia and perhaps keeping some of the territory we have acquired from Czechoslovakia and Romania in return for a peaceful surrender. \n\n No doubt the Russians will probably ask us to switch sides and join them in the last fight against Germany but the casualties and damage to our nation will be much reduced either way."
ERM_hungary.1.a:0 "Negotiate Surrender"
ERM_hungary.1.b:0 "Stay loyal to Germany"
ERM_hungary.2.t:0 "Hungary Asks to Negotiate Surrender"
ERM_hungary.2.d:0 "We have gotten word from Hungary that they wish to surrender due to the inevitability of the Axis defeat. We can either accept their surrender as is, accept their surrender but ask them to switch their sides, or crush the bastards for siding with the Fascists in the first place!"
ERM_hungary.2.a:0 "Accept their surrender"
ERM_hungary.2.b:0 "Accept it but only if they switch sides"
ERM_hungary.2.c:0 "There shall be no surrender!"
ERM_hungary.201.t:0 "Soviets Accept Our Surrender!"
ERM_hungary.201.d:0 "The Soviet Union has told us that they accept our surrender, we have already issued orders to the front and men have begun to lay down arms. \n\n The war may have been lost but our nation has been spared!"
ERM_hungary.201.a:0 "Hurrah!"
ERM_hungary.20101.t:0 "Hungary has surrendered to the Soviets!"
ERM_hungary.20101.d:0 "The Hungarian bastards have secretely behind our back managed to arrange a deal to surrender to the Soviet Union! \n\n We can either let them be or we can try to take over as much of their country as possible and use it to hold back the Russians from our borders as they will inevitably otherwise roll their tanks through hungary to get to our southern flank."
ERM_hungary.20101.a:0 "Crush them..."
ERM_hungary.20101.b:0 "Let them be..."
ERM_hungary.202.t:0 "Soviets Accept Our Surrender on Terms!"
ERM_hungary.202.d:0 "The Soviet Union has told us that they accept our surrender but we must in turn agree to turn our arms against the Germans and help them defeat our former ally. \n\n Whilst this is not the ideal situation we will none-the-less sustain much less casualties and destruction as this war shall not last much longer and the military might of Germany is far from what it used to be."
ERM_hungary.202.a:0 "We accept"
ERM_hungary.202.b:0 "We decline"
ERM_hungary.20201.t:0 "Hungary Betrays Us!"
ERM_hungary.20201.d:0 "The Hungarian bastards have not only gone behind our back to sign a surrender with the Bolshevik's but they have also agreed to and have indeed declared war on us turning their arms against us during our time of need!"
ERM_hungary.20201.a:0 "We shall crush them..."
ERM_hungary.20202.t:0 "Hungary Declines Terms!"
ERM_hungary.20202.d:0 "The Hungarians have declined our gracious terms for their surrender if they only turn their arms against their former allies."
ERM_hungary.20202.a:0 "Fools, we shall crush them!"
ERM_hungary.203.t:0 "Soviets Refuse Our Surrender!"
ERM_hungary.203.d:0 "The Soviet Union has refused to continue talks about a surrender, they have instead told our diplomats that they will force us to an unconditional surrender."
ERM_hungary.203.a:0 "We shall defend our nation to the end!"
ERM_hungary.3.t:0 "Fall of the Horthy Government!"
ERM_hungary.3.d:0 "My Nemzetvezető! \n\nThe Horthy Government has fallen today with the swift work of the German Special Operations forces who have forced Horthy and his cronies to resign making way for us to establish our cabinet. \n\nWith the corrupt traitorous Horthy gone who was willing to sell our nation over to the Bolshevik hordes we can finally truly best serve the interests of Hungary and its people. We shall need to prepare the nation for total war, our fate is tied to that of Germany and defeat is not an option. Hungary will emerge victorious or it will cease to exist, there is no alternative!"
ERM_hungary.3.a:0 "Despite it all...!"
ERM_hungary.4.t:0 "Purge of the Traitors"
ERM_hungary.4.d:0 "My Nemzetvezető, \n\nWith the fall of the Horthy Government we have begun to gather up known traitors who would rather collaborate with the evil Bolsheviks and sell our country out than to fight for it. This should destabilize us a little in the mean time, but it will in the end result in am ore cohesive and dedicated cabinet and armed forces that is filled with loyal party supporters!"
ERM_hungary.4.a:0 "Perhaps they ought to have some concentration..."
ERM_hungary.5.t:0 "[GetMonth] Coup"
ERM_hungary.5.d:0 "Dear Regent, \n\nWe have carried out a small coup against the corrupted amateur known as Döme Sztójay with the approval of our German overlords who gave in after we used our limited powers to protest Sztójay's appointment due to his increasingly controversial actions. \n\nIt was a bloodless coup with General Géza Lakatos rolling into the capital armed with a single tank forcing Sztójay and his cabinet to pack their bags. \n\nHOWEVER, the writing is on the walls that if we wish to exercise our rights to determine the future of the Hungarian nation instead of blindly following orders from Berlin it will not be easy as the Germans would much rather use our nation as cannon fodder and continue their lost cause rather than save both of our nations from the impending destruction that awaits if we continue this futile effort."
ERM_hungary.5.a:0 "Great!"
ERM_hungary.6.t:0 "General Béla Miklós Defects!"
ERM_hungary.6.d:0 "With the Red Army approaching our borders General Béla Miklós who has for a while now supported leaving the Axis powers decided to defect and joined the Red Army after suspecting he was about to be arrested by the Germans. \n\nWord has it that he is planning to form a sort of 'Hungarian Liberation Army' with captured POW's."
ERM_hungary.6.a:0 "We must do what we have to at times"
